import React from 'react';
import ReactDOM from 'react-dom/client';
// NOTE: Assuming RealEstateChatbot.jsx is located in 'frontend/src/'
// If you moved RealEstateChatbot.jsx to 'frontend/src/components/', adjust the path: './components/RealEstateChatbot.jsx'
import App from './RealEstateChatbot.jsx';

// Create the root element and render the main App component inside it.
const rootElement = document.getElementById('root');
if (rootElement) {
    const root = ReactDOM.createRoot(rootElement);
    root.render(
        <React.StrictMode>
            <App />
        </React.StrictMode>
    );
} else {
    console.error("Failed to find the root element with ID 'root' in index.html.");
}
